    <li>
        <h6>Nombre: {e.nombre}</h6>
        <h6>Ciudad: {e.ciudad}</h6>
        <h6>Descripcion: {e.descripcion}</h6>
        <img src={props.foto} alt='url no valida' /> 
         </li>)}
     </ul>
  </div>
  )
}
